import React from 'react';

import { makeStyles } from '@material-ui/styles';

import Paper from '@material-ui/core/Paper';
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/InputLabel';
import Select from '@material-ui/core/Select';

import styles from '../../assets/styles/components/forms/gyminputformStyle.js';

const useStyle = makeStyles(styles);

export default function GymInputForm(props) {
    //props workout = workoutRoutine object

    const classes = useStyle();

    // states 
    const [state, setState] = React.useState({
        workout: props.workout.name,
        routine: "upper"
    });
    const handleChange = (event) => {
        const name = event.target.name;
        setState({
            ...state,
            [name]: event.target.value,
        });
    };

    return (
        <Paper className={classes.paper}>
             <MuiPickersUtilsProvider utils={DateFnsUtils} className={classes.select}>
                <FormControl variant="outlined" className={classes.formControl}>
                    <InputLabel htmlFor="outlined-age-native-simple">Workout</InputLabel>
                    <Select
                        native
                        value={state.workout}
                        onChange={handleChange}
                        label="Workout"
                        name="workout"
                    >
                        <option >{state.workout}</option>
                        <option >Twenty</option>
                        <option >Thirty</option>
                    </Select>
                </FormControl>
                <FormControl variant="outlined" className={classes.formControl}>
                    <InputLabel htmlFor="outlined-age-native-simple">Routine</InputLabel>
                    <Select
                        native
                        value={state.workout}
                        onChange={handleChange}
                        label="Workout"
                        name="workout"
                    >
                        <option >{state.workout}</option>
                        <option >Twenty</option>
                        <option >Thirty</option>
                    </Select>
                </FormControl>
                <KeyboardDatePicker
                    disableToolbar
                    variant="inline"
                    format="MM/dd/yyyy"
                    margin="normal"
                    id="date-picker-inline"
                    label="Date picker inline"
                    value={selectedDate}
                    onChange={handleDateChange}
                    KeyboardButtonProps={{
                        'aria-label': 'change date',
                    }}
                />
            </MuiPickersUtilsProvider> 
        </Paper>
    );
}
